import image1 from "assets/img/gridlist/1.jpg";
import image2 from "assets/img/gridlist/1.jpg";
import image3 from "assets/img/gridlist/3.jpg";
import image4 from "assets/img/gridlist/4.jpg";
import image5 from "assets/img/gridlist/5.jpg";
import image6 from "assets/img/gridlist/6.jpg";
<div className={classes.imageGrid}>
  <GridList cellHeight={180} className={classes.gridList}>
    {tileData.map((tile,i) => (
      <GridListTile key={tile.img} cols={tile.cols} rows={tile.cols}>
        <ButtonBase
            focusRipple
            className={classes.image}
            focusVisibleClassName={classes.focusVisible}
            style={{
              position: "unset"
            }}
          >
            <span >
              <img src={tile.fullWeb} alt={tile.title} className={classes.gridImg} />
            </span>
            <span className={classes.imageBackdrop} />
          </ButtonBase>
      </GridListTile>
    ))}
  </GridList>
</div>
const tileData = [
    {
      img: image1,
      fullWeb: image1,
      title: 'baby_black',
      author: 'baby',
      color: 'inherit',
      enable: "0",
      cols: 2,
    },
    {
      img: image3,
      fullWeb: image3,
      title: 'sweater_black',
      author: 'sweater',
      color: 'inherit',
      enable: "0",
      cols: 1,
    },
    {
      img: image4,
      fullWeb: image4,
      title: 'sweater_blue',
      author: 'sweater',
      color: 'inherit',
      enable: "0",
      cols: 1,
    },
    {
      img: image2,
      partWeb: image2,                                     
      title: 'baby_blue',
      author: 'baby',
      enable: "1",
      cols: 2,
    },
    {
      img: image5,
      partWeb: image5, 
      title: 'baby_chocolate',
      author: 'baby',
      enable: "1",
      cols: 1,
    },
    {
      img: image6,
      partWeb: image6, 
      title: 'baby_pink',
      author: 'baby',
      enable: "1",
      cols: 1,
    }
];

export default tileData;
